import axios from "axios";
//import { getData } from "../lib/api/mainTag_Data";

function Main() {
  useEffect(async () => {
    try {
      const getData = await axios.get(
        "../hotseller-dataset/pretty/hashtag_trend.json"
      );
      console.log("getData", getData);
    } catch (e) {}
  }, []);
  return (
    <>
      <div>dddddddddd</div>
    </>
  );
}

export default Main;
